// import logo from './logo.svg';

// import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { publicRoutes } from './routes';
function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    {publicRoutes.map((route, index) => {
                        return <Route />;
                    })}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
